		"id_str": "1292481174292459521",
		"full_text": "2010년 인근의 두리반 농성 당시, 물심으로 도운 것이 룰사장이었다. 앞장 서서 티내며 돕진 않았으나, 농성에 지친 활동가나 예술가들이 눈치 안 보고 쉴 수 있도록 배려했고, 인쇄 등이 필요할 때는 본인 카페의 인쇄기를 제공했다. 자연스레 농성이 끝난 이후로도 아지트처럼 기능하게 되었다.",
