		"text": "Museum은 전시교육장인가 사회참여기관인가. 정체성 논란. 기존 정의는 인류 유산의 전시/교육/연구/향유 위한 환경, 사회에 봉사하는 비영리 기관. 사회정의 세계불평등 환경 등 현안 다뤄야 한다는 요구 따라 국제박물관협회 재정의 작업. 국가들 이견. 위원 회장 사임 진통.https://t.co/FtnDWz63yg"
