		"text": "亲爱的KDG们大家好，我们是大王KDG——新少年乐队！\n非常荣幸可以在此向各位粉丝们问好，也非常感谢每一位购买了MD的朋友们。同时也想祝贺所有热爱新少年的大家正式成为KDG的一员。\n我们向各位KDG们承诺，无论何时我们都会坚守初心，和大家一起携手走下去。新少年祝愿大家生活幸福美满。"
