		"text": "이 글을 보고 고민하다가 올립니다. 저는 시인동네에 게스트 기획자로 한번 일한 적이 있습니다. 그런데 제가 회의실에 입장하자마자 \"역시 여자분이 계시니 분위기가 다르네\" 같은 소리를 들었고 회의가 끝나고 저녁을 먹은 후 2차를 가자는 제안에 거절했더니 뜬금없이 남자친구 있냐고 물었습니다. https://t.co/Bx3eZiUvg3"
