		"id_str": "1289488340694130688",
		"full_text": "많은 팬들이 쭉 느껴온 대로 두 사람(속성)의 합은 신기할 만큼 참 조화롭다. 이 앨범에 유독 진심이었다던 에스엠도 이걸 잘 아는 것 같다. 유난히 강조하던 이 합을 어떻게 표현했을까? 그 일부를 보기에 앞서서 레드벨벳에게 무척 중요한 의미를 갖는 알파벳 'V'에 대해 살펴야 한다.",
